import Sidebar from './components/sidebar/sidebar.component';
import Introduction from './components/introduction/introduction.component';
import { GlobalStyle } from './global.styles'

function App() {
  return (
    <div className="app">
      <GlobalStyle />
      <Sidebar />
      <div className="main">
        <Introduction />
      </div>
    </div>
  );
}

export default App;
